import React from 'react';

function BottomNav() {

    return(
        <div className='NavContainer' style={{display: 'flex', flexDirection: 'row'}}>
            <div className='Channels' style={{display: 'flex'}}>
                <button style={{width: 80, height: 50}}>Channels</button>
            </div>
            <div className='Feed' style={{display: 'flex'}}>
                <button style={{width: 80, height: 50}}>Feed</button>
            </div>
            <div className='Options' style={{display: 'flex'}}>
                <button style={{width: 80, height: 50}}>Options</button>
            </div>
        </div>
    )
}

export default BottomNav;
